/**
 * Define export function
 */
function exportReport() {

  // So that we know export was started
  console.log("Starting export...");

  // Define IDs of the charts we want to include in the report
  var ids = ["chartdiv"];

  // Collect actual chart objects out of the AmCharts.charts array
  var charts = {},
    charts_remaining = ids.length;
  for (var i = 0; i < ids.length; i++) {
    for (var x = 0; x < AmCharts.charts.length; x++) {
      if (AmCharts.charts[x].div.id == ids[i])
        charts[ids[i]] = AmCharts.charts[x];
    }
  }

  // Trigger export of each chart
  for (var x in charts) {
    if (charts.hasOwnProperty(x)) {
      var chart = charts[x];
      chart["export"].capture({}, function() {
        this.toJPG({}, function(data) {

          // Save chart data into chart object itself
          this.setup.chart.exportedImage = data;

          // Reduce the remaining counter
          charts_remaining--;

          // Check if we got all of the charts
          if (charts_remaining == 0) {
            // Yup, we got all of them
            // Let's proceed to putting PDF together
            generatePDF();
          }

        });
      });
    }
  }

  function generatePDF() {


    // Log
    console.log("Generando PDF...");

    // Initiliaze a PDF layout

    var layout = {
      "content": [
      ]
    };
    layout.content.push({
      "image": "data:image/png;base64,",
      "fit": [110, 140]
    });
    layout.content.push({

      "text": document.getElementById("Titulo").innerHTML, alignment: 'center',
    });

    layout.content.push({
      "text": document.getElementById("subtitulo").innerHTML
    });
    // Add bigger chart
    layout.content.push({
      "image": charts["chartdiv"].exportedImage,
      "fit": [523, 300]
    });

    layout.content.push({

    });


    
    // Trigger the generation and download of the PDF
    // We will use the first chart as a base to execute Export on
    chart["export"].toPDF(layout, function(data) {
      this.download(data, "application/pdf", "amCharts.pdf");
    });

  }
}